/* global BigInt */
import './App.css';
// import { useEffect } from 'react';
import { w_keygen } from "dkg";
import { useWasm } from './useWasm';


function App() {
  // make sure the wasm blob is loaded
  useWasm();

  return (
    <div className="App">
      <div>
        <h2>DKG Wasm Example</h2>
      </div>
      <div>
        <span>
          Generate keys
        </span>
        <input type='number' placeholder='2' value={threshold} />
        <button onClick={() => {
          let k = w_keygen(BigInt(23), 2);
          console.log(k);
        }}>
          Keygen
        </button>
      </div>
    </div>
  );
}

export default App;
